const Posts = ({ posts }) => {
    return (
        <div className="posts">
            {posts && posts.map(post => (
                <Post
                    key={post._id}
                    id={post._id}
                    username={post.username}
                    userId={post.user}
                    image={post.image}
                    caption={post.caption}
                />
            ))}
        </div>
    );
};

export default Posts
